package main

import (
	"testing"
)

var tests = []struct {
	s    string
	p    string
	want []int
}{
	{"cbaebabacd", "abc", []int{0, 6}},
	{"abab", "ab", []int{0, 1, 2}},
	{"", "a", []int{}},
	{"aaaaaaaaaa", "aaaaaaaaaaaaa", []int{}},
	//{"", "", []int{}},
}

func TestFindAnagrams(t *testing.T) {
	for _, test := range tests {
		got := findAnagrams(test.s, test.p)
		if len(got) != len(test.want) {
			t.Errorf("findAnagrams(%v, %v) = %v; want %v\n", test.s, test.p, got, test.want)
			continue
		}
		for i, x := range test.want {
			if x != got[i] {
				t.Errorf("findAnagrams(%v, %v) = %v; want %v\n", test.s, test.p, got, test.want)
				continue
			}
		}
	}
}
